{
  "root": true,
  "ignorePatterns": ["**/*"],
  "plugins": ["@nx"],
  "overrides": [
    {
      "files": ["*.ts", "*.tsx", "*.js", "*.jsx"],
      "rules": {
        "@typescript-eslint/quotes": [
          "error",
          "double",
          {
            "allowTemplateLiterals": true
          }
        ],
        "@nx/enforce-module-boundaries": [
          "error",
          {
            "allow": ["@pezzo/kafka"],
            "enforceBuildableLibDependency": true,
            "depConstraints": [
              {
                "sourceTag": "*",
                "onlyDependOnLibsWithTags": ["*"]
              }
            ]
          }
        ]
      }
    },
    {
      "files": ["*.ts", "*.tsx"],
      "extends": ["plugin:@nx/typescript"],
      "rules": {
        "@typescript-eslint/quotes": [
          "error",
          "double",
          {
            "allowTemplateLiterals": true
          }
        ]
      }
    },
    {
      "files": ["*.js", "*.jsx"],
      "extends": ["plugin:@nx/javascript"],
      "rules": {}
    }
  ]
}

{
  "singleQuote": false,
  "plugins": ["prettier-plugin-tailwindcss"],
  "tailwindConfig": "./apps/console/tailwind.config.js",
  "tailwindFunctions": ["clsx", "cva"]
}

{
  "babelrcRoots": ["*"]
}

import { CodegenConfig } from "@graphql-codegen/cli";

const OFFLINE =
  process.env.OFFLINE === "true" || process.env.GITHUB_ACTIONS === "true";

const schema = OFFLINE
  ? "./apps/server/schema.graphql"
  : "http://localhost:3000/graphql";

const config: CodegenConfig = {
  schema,
  documents: ["./apps/console/src/graphql/definitions/**/*"],
  ignoreNoDocuments: true, // for better experience with the watcher
  generates: {
    "./apps/server/src/@generated/graphql/": {
      preset: "client",
      plugins: [],
    },
    "./apps/console/src/@generated/graphql/": {
      preset: "client",
      plugins: [],
    },
  },
};

export default config;

{
  "$schema": "https://ui.shadcn.com/schema.json",
  "style": "new-york",
  "rsc": false,
  "tailwind": {
    "config": "apps/console/tailwind.config.js",
    "css": "apps/console/src/app/global.css",
    "baseColor": "stone",
    "cssVariables": true
  },
  "aliases": {
    "components": "@pezzo/ui/components",
    "utils": "@pezzo/ui/utils"
  }
}

import { getJestProjects } from "@nx/jest";

export default {
  projects: getJestProjects(),
};

{
  "$schema": "./node_modules/nx/schemas/nx-schema.json",
  "tasksRunnerOptions": {
    "default": {
      "runner": "nx-cloud",
      "options": {
        "cacheableOperations": [
          "prebuild",
          "build",
          "lint",
          "test",
          "e2e",
          "prisma:generate",
          "graphql:generate",
          "graphql:codegen",
          "build-storybook"
        ]
      }
    }
  },
  "targetDefaults": {
    "build": {
      "dependsOn": ["^build"],
      "inputs": ["production", "^production"]
    },
    "test": {
      "inputs": ["default", "^production", "{workspaceRoot}/jest.preset.js"]
    },
    "e2e": {
      "inputs": ["default", "^production"]
    },
    "lint": {
      "inputs": [
        "default",
        "{workspaceRoot}/.eslintrc.json",
        "{workspaceRoot}/.eslintignore"
      ]
    },
    "build-storybook": {
      "inputs": [
        "default",
        "^production",
        "{projectRoot}/.storybook/**/*",
        "{projectRoot}/tsconfig.storybook.json"
      ]
    }
  },
  "namedInputs": {
    "default": ["{projectRoot}/**/*", "sharedGlobals"],
    "production": [
      "default",
      "!{projectRoot}/**/?(*.)+(spec|test).[jt]s?(x)?(.snap)",
      "!{projectRoot}/tsconfig.spec.json",
      "!{projectRoot}/jest.config.[jt]s",
      "!{projectRoot}/.eslintrc.json",
      "!{projectRoot}/src/test-setup.[jt]s",
      "!{projectRoot}/**/*.stories.@(js|jsx|ts|tsx|mdx)",
      "!{projectRoot}/.storybook/**/*",
      "!{projectRoot}/tsconfig.storybook.json"
    ],
    "sharedGlobals": ["{workspaceRoot}/babel.config.json"]
  },
  "generators": {
    "@nx/react": {
      "application": {
        "style": "css",
        "linter": "eslint",
        "bundler": "webpack",
        "babel": true
      },
      "component": {
        "style": "css"
      },
      "library": {
        "style": "css",
        "linter": "eslint"
      }
    },
    "@nx/next": {
      "application": {
        "style": "css",
        "linter": "eslint"
      }
    }
  }
}

{
  "name": "pezzo",
  "$schema": "node_modules/nx/schemas/project-schema.json",
  "targets": {}
}

{
  "extends": "./tsconfig.base.json"
}
